import React from "react";
import Carousel from "react-bootstrap/Carousel";


const CarouselItemBrand = (props) => {
    return (
        <Carousel>

            <Carousel.Item>
                <img
                    className="w-100"
                    src={props.src}
                    alt={props.srcImg}
                />
                <Carousel.Caption>
                    <h3>{props.heading}</h3>
                    <p>{props.detail}</p>
                </Carousel.Caption>
            </Carousel.Item>

        </Carousel>
    );
};


export default CarouselItemBrand;
